		var hBellyTitle   =  $('.cover-title').height();
		var hBellyAside   =  $('.cover-aside').height();
		var hBellyPhoto   =  $('.cover-photo').height();

		var hSum          =  hWindow - parseInt(hBellyTitle + hBellyAside);
		var hSup 		  =  parseInt(hWindow - hBellyTitle);

